import React from 'react';

const AidbSection: React.FC = () => {
  return (
    <section id="aidb" className="py-16 bg-white border-b border-neutral-200">
      <div className="container-max px-4 sm:px-6 lg:px-8">
        <h2 className="text-4xl sm:text-5xl font-extrabold text-neutral-900 dark:text-white leading-tight mb-4">
          project (a)idb
        </h2>
        <p className="text-lg text-neutral-500 dark:text-neutral-400 max-w-2xl mb-12">
          Vibe coding has become one of my favorite hobbies, and I've made it a personal goal to create and publish some sort of project twice a month.  
        </p>
        <div className="grid md:grid-cols-2 gap-8">
          <div className="bg-white border border-neutral-200 rounded-lg shadow-sm p-8 flex flex-col justify-between">
            <h3 className="text-2xl font-bold text-neutral-900 mb-4">Project Placeholder 1</h3>
            <p className="text-neutral-600 mb-6">Add your first (a)idb project here. Describe what it is, what you learned, or anything you want to share.</p>
          </div>
          <div className="bg-white border border-neutral-200 rounded-lg shadow-sm p-8 flex flex-col justify-between">
            <h3 className="text-2xl font-bold text-neutral-900 mb-4">Project Placeholder 2</h3>
            <p className="text-neutral-600 mb-6">Add your second (a)idb project here. Describe what it is, what you learned, or anything you want to share.</p>
          </div>
        </div>
      </div>
    </section>
  );
};

export default AidbSection;
